This fix works with the latest version of ESET while purefix 2.03 fails to make it work properly. (Update problem, when you try to update your virus database it asks for the user name and password)
I myself tried it. It worked.
1.Extract the .rar(But keep in mind when you do so you have to disable your anti-virus as its most likely to be detected as a virus)
2.Boot your computer into safe mode
3.Run Eset fix.exe and click on fix button
4.Reboot into normal mode 
5.Done

